import React from "react";
import { Button } from "react-bootstrap";

const TableRow = ({ loan, editLoan, deleteLoan }) => {
  return (
    <tr>
      <td>{loan.loanid}</td>
      <td>{loan.loanType}</td>
      <td>{loan.duration}</td>
      <td>
        <Button
          variant="secondary"
          onClick={() =>
            editLoan(loan.loanid, {
              Loanid: loan.loanid,
              LoanType: loan.loanType,
              Duration: loan.duration,
            })
          }
        >
          Edit
        </Button>
        <Button variant="danger" onClick={() => deleteLoan(loan.loanid)}>
          Delete
        </Button>
      </td>
    </tr>
  );
};

export default TableRow;
